import axios from "axios";


const usersRequest = () =>{

    const request = async () =>{
        try {
            const response = await axios.get('https://venbest-test.herokuapp.com/');
            const {data} = response;
            console.log(data.results)

        }
        catch (error) {

        }
    }
    return request;
}

export default usersRequest;
